Points $A,$ $B,$ and $C$ are placed on a circle centered at $O$ as in the following diagram: [asy]
pair pA, pB, pC, pO;
pO = (0, 0);
pA = pO + dir(-40);
pB = pO + dir(32);
pC = pO + dir(176);
draw(pA--pO--pB--pC--pA);
label("$O$", pO, 2 * E);
label("$A$", pA, SE);
label("$B$", pB, NE);
label("$C$", pC, W);
draw(circle(pO, 1));
[/asy] If $AC = BC$ and $\angle OAC = 18^\circ,$ then how many degrees are in $\angle AOB$?

inference:
Since $AC = BC,$ triangle $ABC$ is isosceles. Therefore, $\angle ABC = \angle BAC = \frac{180^\circ - \angle ACB}{2}.$

