label("$O$", pO, 2 * E);
label("$A$", pA, SE);
label("$B$", pB, NE);
label("$C$", pC, W);
draw(circle(pO, 1));
label("$18^\circ$", (pA + pO)/2, SE);
label("$\frac{180^\circ - \angle ACB}{2}$", (pA + pC)/2, S);
label("$\frac{180^\circ - \angle ACB}{2}$", (pB + pC)/2, S);
[/asy]

Since $\angle OAC = 18^\circ,$ $\angle CAB = 180^\circ - \angle OAC = 162^\circ.$ Thus, $\angle ABC = 162^\circ.$  Now, $\angle AOB = 360^\circ - \angle BOA - \angle AOC = 360^\circ - \angle BAC - \angle OAC = 360^\circ - 162^\circ - 18^\circ = \boxed{180^\circ}.$  Since $\angle AOB = 180^\circ,$ points $A,$ $O,$ and $B$ are collinear.

